// src/App.js

import React, { useEffect, useState } from "react"; // Import React và các hook cần thiết
import MapComponent from "./components/MapComponent"; // Import component MapComponent

function App() {
  const [cars, setCars] = useState([]); // State lưu danh sách xe

  useEffect(() => {
    // Gọi API backend để lấy danh sách xe
    const fetchCars = async () => {
      try {
        const response = await fetch("http://localhost:5000/api/cars");
        const data = await response.json();
        setCars(data); // Cập nhật danh sách xe
      } catch (error) {
        console.error("Failed to fetch cars:", error);
      }
    };

    fetchCars();
  }, []);

  return (
    <div>
      <h1>Car Locations</h1>
      <MapComponent cars={cars} /> {/* Truyền danh sách xe vào MapComponent */}
    </div>
  );
}

export default App;
